import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Output() {
    const [logs, setLogs] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetchLogs();
    }, []);

    const fetchLogs = async () => {
        try {
            const response = await axios.get('/output'); // Send a GET request to fetch logs
            console.log('Received Logs from backend:', response.data);
            setLogs(response.data); // Set the received logs data
            setLoading(false);
        } catch (error) {
            console.error('Error fetching logs:', error);
            setLoading(false);
        }
    };

    if (loading) {
        return <div>Loading...</div>;
    }

    if (logs.length === 0) {
        return <div>Logs Loading...</div>;
    }

    return (
        <div>
            <h2>Logs:</h2>
            <ul>
                {logs.map((log, index) => (
                    <li key={index}>{log}<br /> <br /></li>
                ))}
            </ul>
        </div>
    );
    
}

export default Output;
